import styled from "styled-components";

export const ComponentUserDetail = () => {
    return (
        <StyledCart>
            <div className="become"></div>
        </StyledCart>
    );
};

const StyledCart = styled.div`
    width: 88%;
    margin: 0 auto;
    padding: 0 24px;
    background-color: #fff;
    box-shadow: rgb(204 204 204) 0px 0px 3px 2px;
    border-radius: 4px;
`;
